(88, 'CENTRO ESTUDIOS CESUR ', 'Calle De Luis Cabrera, 63 ', 'Madrid', '913005958', 'Privado', '<h4>¿QUIÉNES SOMOS?</h4><br/>\nCentro Superior de Formación Europa Sur (Cesur), se funda dentro del seno del Grupo Coremsa, un Grupo Empresarial especializado, entre otras actividades, en el ámbito formativo. La Formación Profesional de Grado Superior es, desde hace años, una prioridad dentro de Grupo Coremsa, por lo que hemos apostado fuerte por esta formación poniendo al alcance de nuestros alumnos los medios técnicos más avanzados y funcionales, así como a un equipo cualificado de profesionales docentes.\n<br/>\nActualmente, Cesur cuenta con dieciocho Centros Oficiales de Formación Profesional de Grado Superior: Madrid, Málaga Centro, Málaga PTA (Parque Tecnológico de Andalucía), Málaga CTM (Centro de Transporte de Mercancías), Las Palmas de Gran Canaria, Santa Cruz de Tenerife, Sevilla, Murcia y Badajoz. Estos centros imparten más de cien titulaciones oficiales nacionales, tanto en modalidad presencial como distancia, homologadas por las correspondientes Consejerías de Educación de cada Comunidad Autónoma.\n<h4>¿POR QUÉ ESTUDIAR EN CESUR?</h4>\nDesde CESUR ofrecemos todo aquello que consideramos es la esencia de nuestro sistema pedagógico y educativo, basado en:\n<br/>\nLa exigencia y el estímulo. El uso eficiente del tiempo, una adecuada combinación de la teoría y la práctica. Enfocar esfuerzos a conseguir un alumnado con aptitudes diferenciadas sobre el resto de profesionales. La adquisición de una experiencia práctica previa a la finalización de los estudios que exige preparar a cada estudiante de la manera más óptima para el ejercicio profesional.\n<br/>\nNo solo nos interesa que nuestro alumnado obtenga la titulación correspondiente al Ciclo Formativo elegido, sino que además se conviertan en profesionales con aptitudes diferenciadas, perfectamente entrenados para abrirse camino en entornos competitivos y con una visión global en nuestro mundo laboral.\n<br/>\n<h4>Plan de estudios</h4>\n<br/>\nLos programas han sido diseñados bajo un planteamiento realista y flexible, adaptando los contenidos a la demanda actual y necesidades del entorno laboral más cercano. Detallando en todo momento la descripción del ciclo, la duración de cada módulo y dando una visión general de las prácticas que se desarrollarán durante el curso.\n<br/>\nSe ha pretendido que se compaginen asignaturas teóricas para tener una buena base y conocimientos esenciales de la materia de estudio y el desarrollo de las prácticas necesarias, para adquirir esa experiencia tan demandada por las empresas.\n<br/>\n \n<h4>Sistema de evaluación continua</h4>\n<br/>\nEl control de asistencia, la participación del alumno en clase, la realización de pruebas periódicas de evaluación y el desarrollo de trabajos y casos prácticos, individualmente o en equipo, garantizan el estudio y trabajo constante del alumno a lo largo del curso académico, tanto en la modalidad presencial como en la modalidad on-line.\n<br/>\n \n\n<h4>Clases reducidas y atención personalizada</h4>\n<br/>\nUna ventaja evidente en nuestros ciclos son las clases reducidas y la atención personalizada que reciben nuestros alumnos, contando en todo momento con sus respectivos tutores. Estos atienden al alumno de forma constante a lo largo del curso académico y en sus horas de tutoría para orientarlos en los aspectos docentes y profesionales.\n<br/>\n<h4>Clases reducidad y atención personalizada\n <br/>\n\n \n<h4>Equipamiento al más alto nivel</h4>\n<br/>\nCESUR cuenta con instalaciones dotadas de importantes recursos tecnológicos para atender a una demanda de enseñanza acorde a las nuevas tecnologías de nuestro entorno.\n<br/>\nNuestros centros disponen de tecnología WIFI para el acceso a Internet, equipos y soporte informático de última generación, así como una tecnología multimedia y audiovisual puntera. Esto permite a los alumnos dominar las herramientas y nuevas tecnologías necesarias para el desarrollo de la actividad profesional, y a los docentes adaptar las clases a un entorno más ameno situándonos en una posición de ventaja competitiva y tecnológica, todo ello de acuerdo con las peculiaridades de cada especialidad.\n<br/>\n \n\n<h4>Equipo docente</h4>\n\n <br/>\n\nNuestro Claustro de Profesores, seleccionado cuidadosamente, está integrado por profesionales altamente cualificados dotados de acreditada experiencia y categoría profesional, procedentes de la Empresa Privada, Administración Pública y de la Universidad; todos ellos capaces de transmitir a los alumnos la realidad de la experiencia adquirida en su respectiva actividad.\n<br/>\nEl éxito de su labor docente se pone de manifiesto en la calidad de los planes y programas de estudios y en el elevado grado de satisfacción e integración profesional de nuestros alumnos.\n<br/>\n<h4>Actividades fuera del aula</h4>\n<br/>\nEs para nosotros igual de importante mantener un contacto directo con el entorno empresarial relacionado con los ciclos que impartimos. Por ello se llevan a cabo a lo largo del curso académico diversas visitas organizadas de forma que se le proporcione al alumno una visión práctica y real del entorno al que se enfrentará una vez concluida su formación.\n<br/>\n \n<h4>La formación en centros de trabajo</h4>\n<br/>\nDurante el periodo de Formación en Centros de Trabajo es cuando el alumno entra en contacto directo con el auténtico día a día de una empresa y, bajo la tutela de un tutor, desarrolla un periodo de formación en prácticas obligatorias de duración no inferior a 200 horas, dentro de un centro de trabajo designado. Son los últimos tres meses del 2º año y para ello Cesur posee acuerdos y convenios de colaboración con distintas empresas de los diferentes sectores que abarca nuestra amplia oferta formativa.', 'principal', 'cesur.jpg'),
