(97, 'IES CLARA DEL REY', 'Calle Del Padre Claret, 8 ', 'Madrid', '915195257', 'Público', 'El IES Clara del Rey es un centro público que imparte formación profesional específica en las modalidades presencial, dual, bilingüe y distancia.<br/>Jefatura de estudios de modalidad presencial y a distancia:\n<br/>\nDe lunes a viernes. \nPrevia petición de hora.\n<br/>\nTeléfono: 915195257<br/>\nFax: 915195363<br/>\nCorreo electrónico: correo@iesclaradelrey.es<br/>\nJefatura de estudios de FP Dual:<br/>\n<br/>\nDe lunes a viernes. \nPrevia petición de hora al correo electrónico empresas@iesclaradelrey.es\n\n<br/>\nEl IES Clara del Rey RECICLA ... y te invitamos a que lo hagas\nEl reciclaje forma parte de la educación integral que el instituto tiene como objetivo, para ello es necesario que conozcas la siguiente información:\n<br/>\n>> El contenedor azulEn todas la aulas y espacios generales como vestíbulos, biblioteca y departamentos hay papeleras con un PUNTO AZUL para depositar el papel, cartón, periódicos, etc.\n<br/>\n>> El contenedor amarilloEn todos los pasillos, vestíbulos y patios hay papeleras con un PUNTO AMARILLO para depositar los envases como: briks, bolsas de plástico, todo tipo de latas de refresco, envases de yogures de zumos de batidos, etc.\n<br/>\n>> El contenedor verdeEn el vestíbulo de entrada al instituto hay una caja con un PUNTO VERDE para depositar las pilas.\n<br/>\nEn todas las aulas hay una papelera para depositar todo lo que no se deposita en las anteriores es decir: clínex, peladuras de fruta y restos de comida.\n\n<br/>\nClara del Rey (1765-1808), heroína madrileña muerta durante los sucesos del 2 de mayo de 1808, en el Parque de Artillería de Monteleón. Había nacido el 11 de agosto de 1765 en Villalón de Campos (Valladolid), hija de Manuel del Rey y de Teresa Calvo.\n<br/>\nEstuvo animando y ayudando a los defensores junto a su marido y tres hijos. Parece ser que murió por la metralla de una bala de cañón que le alcanzó en la frente. Clara del Rey figura entre las víctimas del 2 de mayo identificadas en el Archivo Municipal de Madrid, donde consta que "deja dos hijos solteros", por lo que es de suponer que en el Parque de artillería Monteleón también murieron su marido y uno de sus hijos.\n<br/>\n<strong>Placa</strong>\nFue enterrada en el cementerio de la Buena Dicha, situado en el hospital del mismo nombre, hoy en día desaparecido y que estaba ubicado en las proximidades de la Gran Vía de Madrid, entre las calles Libreros y Silva. En la fachada de la iglesia de la Buena Dicha (C/Silva,25) tiene Clara del Rey una lápida conmemorativa.\n<br/>\nFuente: Wikipedia\n<br/>\nLa historia ha sido injusta con ella. Mientras la fama se la lleva Manuela Malasaña, víctima inocente de su oficio de costurera al portar unas tijeras tomadas por el invasor como armas, todo hace deducir que fue Clara del Rey la única mujer que perdió la vida luchando en la defensa del Parque de Artillería de Monteleón.\n<br/>\nDiversas fuentes\n<br/>\nUn tebeo reivindica a Clara del Rey como heroína del Dos de Mayo. [ver artículo completo]\n<br/>\nFuente: El País\n<br/>\n', 'principal', 'ies-clara-del-rey.jpg'),
