(253, 'IES LEONARDO DA VINCI', 'Calle Del General Romero Basart, 90 ', 'Madrid', '917064970', 'Público', 'ENSEÑANZAS:\n<br/>\nFORMACIÓN PROFESIONAL BÁSICA: Informática y Comunicaciones<br/>\nFORMACIÓN PROFESIONAL DE GRADO MEDIO: Gestión administrativa - Sistemas microinformáticos y redes - Cuidados auxiliares de enfermería - Atención a personas en situación de dependencia. <br/>\nFORMACIÓN PROFESIONAL DE GRADO SUPERIOR: Administración y finanzas - Dietética -  Salud ambiental - Educación Infantil -  Patronaje y Moda - Desarrollo de aplicaciones web - Administración de sistemas informáticos en red. \n<br/> <br/> CARACTERÍSTICAS GENERALES DE LA FORMACIÓN PROFESIONAL\nLa formación profesional es el nivel educativo que prepara a los alumnos para una actividad profesional y les capacita para el desempeño cualificado de las distintas profesiones.\n<br/>\nFINALIDAD\nLa principal finalidad de la formación profesional en el sistema educativo es la de preparar a los alumnos para la actividad en un campo profesional y facilitar su adaptación a las modificaciones laborales que pueden producirse a lo largo de su vida.\n\nAsí pues, estas enseñanzas tienen por objeto conseguir que los alumnos adquieran las capacidades que les permitan, entre otros logros:\n\nDesarrollar la competencia general correspondiente a la cualificación o cualificaciones objeto de los estudios realizados.\nComprender la organización y características del sector productivo correspondiente, así como los mecanismos de inserción profesional; conocer la legislación laboral y los derechos y obligaciones que se derivan de las relaciones laborales.\nAprender por sí mismos y trabajar en equipo, así como formarse en la prevención de conflictos y en la resolución pacífica de los mismos en todos los ámbitos de la vida personal, familiar y social.\nTrabajar en condiciones de seguridad y salud, así como prevenir los posibles riesgos derivados del trabajo.\nAfianzar el espíritu emprendedor para el desempeño de actividades e iniciativas profesionales.\nLOS CICLOS FORMATIVOS\nLos títulos de Formación Profesional son el instrumento para acreditar las cualificaciones y competencias propias de cada uno de ellos y asegurar un nivel de formación, de forma que su obtención acredite con alcance y validez estatal la formación necesaria para alcanzar la cualificación profesional y posibilitar una adecuada inserción profesional.\n\nLas enseñanzas conducentes a la obtención de los títulos se estructuran en Ciclos Formativos, cuyas características principales son:\n\nOrganización modular, constituida por áreas de conocimientos teórico-prácticos en función de los diversos campos profesionales.\n\nDuración de 2000 horas distribuidas en dos cursos académicos. Incluyen un período de formación práctica en centros de trabajo, de carácter obligatorio, con una duración de 370 horas por Ciclo.\n\nSe establece dos niveles para los Ciclos Formativos de Formación Profesional en función de la cualificación profesional que se alcanza al finalizar los estudios:\n<br/>\nCiclos Formativos de Grado Medio.\nCiclos Formativos de Grado Superior.\nLOS MÓDULOS PROFESIONALES\nEn los Ciclos Formativos, los contenidos están organizados en Módulos Profesionales de conocimientos teórico-prácticos en función de las competencias profesión.\n<br/>\nPRÁCTICAS EN EMPRESAS\nLos Ciclos Formativos incorporan un Módulo de «Formación en Centros de Trabajo» (FCT) que se desarrolla en las empresas o centros de trabajo en un medio productivo real. Su objetivo es completar la formación adquirida en el centro educativo y se realiza en el segundo curso.\n<br/>\nFORMACIÓN PROFESIONAL DE GRADO MEDIO\nCondiciones de acceso\n<br/>\nPara acceder a los Ciclos Formativos de Grado Medio es necesario estar en posesión del título de Graduado en Educación Secundaria Obligatoria. También se puede acceder si se cumple alguno de los siguientes requisitos:\n\nEstar en posesión del título de Graduado en Educación Secundaria.\nEstar en posesión del título de Técnico Auxiliar.\nEstar en posesión del título de Técnico.\nHaber superado el segundo curso de Bachillerato Unificado Polivalente.\nHaber superado el segundo curso del primer ciclo experimental de reforma de las enseñanzas medias.\nHaber superado, de las enseñanzas de Artes Aplicadas y Oficios Artísticos, el tercer curso del plan de 1963 o el segundo de comunes experimental.\nHaber superado otros estudios declarados equivalentes a efectos académicos con alguno de los anteriores.\nSuperar la correspondiente prueba de acceso, para quienes no reúnan ninguno de los requisitos anteriores.\nTitulación\n<br/>\nLa titulación que se obtiene al finalizar el ciclo formativo de grado medio es la de «Técnico» en la profesión correspondiente, certificación homologable en el mercado europeo de trabajo. \n<br/>\nEsta titulación da acceso al Bachillerato en cualquiera de sus modalidades.\nFORMACIÓN PROFESIONAL DE GRADO SUPERIOR\nCondiciones de Acceso\n<br/>\nPara acceder a los Ciclos Formativos de Grado Superior es necesario estar en posesión del título de Bachiller establecido por la Ley Orgánica 2/2006, de 3 de mayo, de Educación. También se puede acceder si se cumple alguno de los siguientes requisitos:\n<br/>\nEstar en posesión del título de Bachiller establecido en la Ley Orgánica 1/1990, de 3 de octubre, de Ordenación General del Sistema Educativo.\nHaber superado el segundo curso de cualquier modalidad de Bachillerato Experimental.\nHaber superado el curso de orientación universitaria o preuniversitario.\nEstar en posesión del título de Técnico Especialista, Técnico Superior o equivalente a efectos académicos.\nEstar en posesión de una titulación universitaria o equivalente.\nSuperar la correspondiente prueba de acceso, para quienes no reúnan ninguno de los requisitos anteriores.\nTitulación \n<br/>\nLa titulación que se obtiene al superar el ciclo es la de «Técnico Superior» en la profesión correspondiente, certificación homologable en el mercado europeo de trabajo.\n<br/>\nEsta titulación da acceso directo a los estudios universitarios que se determinan para cada Título.', 'principal', 'leonardo.jpg'),
